import React, { Component } from 'react';
import axios from 'axios';

export default class Explore extends Component {
    constructor(props) {
        super(props);

        this.onChangeRank = this.onChangeRank.bind(this);
        this.onChangeCountry = this.onChangeCountry.bind(this);
        this.onChangeDate = this.onChangeDate.bind(this);
        this.onChangeSongArtist = this.onChangeSongArtist.bind(this);
        this.onChangeSongTitle = this.onChangeSongTitle.bind(this);
        this.onSearch = this.onSearch.bind(this);

        this.state = {
            rank: "",
            country: "",
            date: "",
            song_artist: "",
            song_title: "",
        };
    };

    onChangeRank(e) {
        this.setState({
            rank: e.target.value,
        });
    };

    onChangeCountry(e) {
        this.setState({
            country: e.target.value,
        });
    };

    onChangeDate(e) {
        this.setState({
            date: e.target.value,
        });
    };

    onChangeSongArtist(e) {
        this.setState({
            song_artist: e.target.value,
        });
    };

    onChangeSongTitle(e) {
        this.setState({
            song_title: e.target.value,
        });
    };

    onSearch(e) {
        e.preventDefault();

        const newSearch = {
            rank: this.state.rank,
            country: this.state.country,
            date: this.state.date,
            song_artist: this.state.song_artist,
            song_title: this.state.song_title,
        };

        axios
            .post("http://localhost:5000/posts/explore", newSearch);

        this.setState({
            rank: "",
            country: "",
            date: "",
            song_artist: "",
            song_title: "",
        });
    };

    render() {
        return (
            <Form horizontal onSubmit={this.onSearch}>
                <FormGroup>
                    <Form.Row>
                        <Col componentClass={ControlLabel} sm={2}>
                            Username:
                        </Col>
                        <Col sm={10}>
                            <FormControl {...username} type="text" />
                        </Col>
                    </Form.Row>
                </FormGroup>
                <FormGroup>
                    <Form.Row>
                        <Col componentClass={ControlLabel} sm={2}>
                            Password:
                        </Col>
                        <Col sm={10}>
                            <FormControl {...password} type="password" />
                        </Col>
                    </Form.Row>
                </FormGroup>
                <FormGroup>
                    <Col>
                        <Button type="submit">Submit</Button>
                    </Col>
                </FormGroup>
            </Form>

        );
    };
};
